import React, {Component} from "react";
class Customer extends Component{
    constructor() {
        super();
        this.state = {
            username:'',
            password:'',
            name:'',
            Phone:'',
            email:''
        }
    }

    changePhone = (event) => {
        this.setState({
            Phone: event.target.value
        })
    }
    changeEmail = (event) => {
        this.setState({
            email: event.target.value
        })
    }
    changeUsername = (event) => {
        this.setState({
            username: event.target.value
        })
    }

    changePassword = (event) => {
        this.setState({
            password: event.target.value
        })
    }


    changeName = (event) => {
        this.setState({
            name: event.target.value
        })
    }

    submitresponse = (event) =>{
        alert('delivery')
    }
    render() {
        return (
                <form onSubmit={this.submitresponse}>
                    Name: <input type="text"  value={this.state.name} onChange={this.changeName}/>
                    Phone: <input type="text" value={this.state.Phone} onChange={this.changePhone}/>
                    Email: <input type="text" value={this.state.email} onChange={this.changeEmail}/>
                    Username: <input type="text" value={this.state.username} onChange={this.changeUsername}/>
                    Password: <input type="password" value={this.state.password} onChange={this.changePassword}/>
                    <input type="submit" value="Register" onSubmit={this.submitresponse}/>
                </form>
        )
    }
}

export default Customer
